<template>
    <div>
        <v-dialog
                :value="visible"
                @input="$emit('update:visible', $event)"
                width="800">
            <v-card>
                <v-text-field
                    v-model="filter.name"
                    label="Search"
                    class="blue-grey darken-2"
                    dark
                    full-width
                    hide-details />

                <v-row no-gutters style="min-height:350px">
                    <v-col cols="12" md="3">
                        <v-list dense dark class="blue-grey darken-3" style="min-height:100%">
                            <v-list-item @click="filter.category = null">
                                All
                            </v-list-item>
                            <v-list-item v-for="(cat, i) in categories" :key="i"
                                    @click="filter.category = cat.id">
                                {{ cat.name }}
                            </v-list-item>
                        </v-list>
                    </v-col>
                    <v-col cols="12" md="9">
                        <v-card-text v-if="!items"
                                class="text-center py-4">
                            <v-progress-circular
                                :size="32"
                                :width="2"
                                color="primary"
                                indeterminate />
                        </v-card-text>
                        <v-card-text v-else>
                            <v-row class="px-2">
                                <v-col v-for="(item, i) in filteredItems" :key="i"
                                    :class="'pa-2 resource-item ' + (selected == item.id ? 'selected' : '')"
                                    style="position:relative"
                                    cols="3"
                                    @click="selected = item.id">
                                    <v-img
                                        :src="item.src || item.blob"
                                        aspect-ratio="1"/>
                                    <div class="text-center">
                                        {{ item.name }}
                                    </div>

                                    <v-btn
                                        absolute top right
                                        small icon
                                        @click="editing = item">
                                        <v-icon small>fas fa-pencil-alt</v-icon>
                                    </v-btn>
                                </v-col>
                            </v-row>
                        </v-card-text>
                    </v-col>
                </v-row>
                
                <v-divider />
                
                <v-card-actions class="grey lighten-3">
                    <v-btn
                        v-if="items"
                        text
                        @click="editing = { }">
                        Add Image
                    </v-btn>
                    <v-spacer />
                    <v-btn v-if="selection !== undefined && selection !== false"
                        color="success"
                        text
                        :loading="!items"
                        :disabled="!items || !selected"
                        @click="$emit('input', selected)">
                        Select
                    </v-btn>
                </v-card-actions>
            </v-card>
        </v-dialog>

        <v-dialog
            v-model="editing.show"
            width="500">
            <v-card v-if="editing.show">
                <v-text-field
                    label="Name"
                    filled
                    v-model="editing.edit.name" />

                <v-card-text>
                    <v-select
                        label="Category"
                        v-model="editing.edit.category"
                        :items="categories"
                        item-value="id"
                        item-text="name"
                        @click.stop="" />

                    <v-text-field
                        label="URL"
                        v-model="editing.edit.src"
                        @changed="editing.edit.src ? delete editing.edit.blob : null" />
                        
                    <!--<v-file-input label="Upload" accept="image/*" show-size />-->
                </v-card-text>
                
                <v-divider />
                
                <v-card-actions class="grey lighten-3">
                    <v-spacer />
                    <v-btn
                        color="success"
                        text
                        :disabled="!editing.edit.name || !editing.edit.category"
                        @click="Object.assign(editing.obj, editing.edit); editing.show = false;">
                        Save
                    </v-btn>
                </v-card-actions>
            </v-card>
        </v-dialog>
    </div>
</template>

<script>
    export default {
        props: ['visible', 'type', 'value', 'selection'],
        data: () => ({
            filter: {
                name: '',
                category: null
            },

            selected: null,
            editing: {
                show: false,
                obj: null,
                edit: null
            },

            categories: [
                { id: 'oof', name: 'Animals' },
                { id: 'wew', name: 'Places' }
            ],
            items: null
        }),
        computed: {
            filteredItems() {
                if(!this.items) return [];
                let name = this.filter.name.toLowerCase();
                return this.items.filter(item => (this.filter.category == null || item.category == this.filter.category)
                                                    && item.name.toLowerCase().includes(name));
            }
        },
        watch: {
            editing(val) {
                if(!val || val.obj) return;

                this.editing = {
                    show: true,
                    obj: val,
                    edit: Object.assign({}, val)
                };
            },
            value(val) {
                this.selected = val;
            }
        },
        mounted() {
            this.selected = this.value;

            setTimeout(() => {
                this.items = [
                    { id: '098y7t6yf', name: 'Hecc', src: 'https://i.imgur.com/VELRewR.jpg' },
                    { id: 'fjurhegrkjgrejkl', name: 'Foxies', blob: ' data:image/png;base64,' },
                    { id: 'rfgthyjuyjyhtgr', name: 'MORE FOXIES', blob: ' data:image/png;base64,' },
                    { id: 't6yu7y53t4', name: 'INFINITE FOPS', blob: ' data:image/png;base64,' }
                ];
            }, 1000);
        }
    }
</script>

<style>
    .resource-item {
        border: 1px solid transparent;
        border-radius: 5px;
    }

    .resource-item .v-image {
        box-shadow: 0 0 5px #999;
    }

    .resource-item .v-btn {
        top: 8px;
        right: 8px;

        display: none;
    }
    
    .resource-item:hover .v-btn {
        display: inherit;
    }

    .resource-item:hover {
        background-color: rgba(0, 0, 0, .05);
    }

    .resource-item.selected {
        border: 1px solid rgba(0, 0, 0, .05);
        background-color: rgba(0, 0, 0, .07);
    }
</style>